import React from 'react';
import Welcome from '../../Welcome';
import Work from '../../Work';
import WorkReverse from '../../WorkReverse';
import {homeObjOne, recentWorkOne, recentWorkTwo, recentWorkThree} from './Data';
import './Home.css';

function Home() {
    return (
        <>
            <Welcome {...homeObjOne} />
            <section className="selected-works-container">
                <div className="selected-works-wrapper">
                    <h3 className="selected">
                        Selected
                    </h3>
                    <h3 className="works">
                        Works
                    </h3>
                </div>
            </section>
            <Work {...recentWorkOne} />
            <WorkReverse {...recentWorkTwo} />
            <Work {...recentWorkThree} />
        </>
    );
}

export default Home;
